const HomeScreen = ({ navigation, route }) => {
  return (
    <button
      title="Go to Jane's profile"
      onClick={() => {
        navigation.navigate("Profile", { name: "Jane" });
      }}
    >
      Contact Us
    </button>
  );
};

export default FormSubmission;
